using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;namespace Foundation{    /// <summary>    /// An NSURLSessionConfiguration object defines the behavior and policies to use when uploading and downloading data using an NSURLSession object. When uploading or downloading data, creating a configuration object is always the first step you must take. You use this object to configure the timeout values, caching policies, connection requirements, and other types of information that you intend to use with your NSURLSession object.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/Foundation/Reference/NSURLSessionConfiguration_class/index.html#//apple_ref/occ/cl/NSURLSessionConfiguration"/>    [iOSVersion(7)]    [Export("")]    public class NSURLSessionConfiguration : NSObject//, AnyObject, CVarArgType, Equatable, Hashable, NSCopying, NSObjectProtocol, Printable    {        public NSURLSessionConfiguration() { }        /// <summary>        /// Returns a newly created default session configuration object.        /// </summary>        [iOSVersion(7)]        [Export("defaultSessionConfiguration")]        public static NSURLSessionConfiguration DefaultSessionConfiguration() { return default(NSURLSessionConfiguration); }                /// <summary>        /// Returns a session configuration that uses no persistent storage for caches, cookies, or credentials.        /// </summary>        [iOSVersion(7)]        [Export("ephemeralSessionConfiguration")]        public static NSURLSessionConfiguration EphemeralSessionConfiguration() { return default(NSURLSessionConfiguration); }                /// <summary>        /// Returns a session configuration object that allows HTTP and HTTPS uploads or downloads to be performed in the background.        /// </summary>        /// <param name="identifier">The unique identifier for the configuration object. This parameter must not be nil or an empty string.</param>        [iOSVersion(8)]        [Export("backgroundSessionConfigurationWithIdentifier")]        public static NSURLSessionConfiguration BackgroundSessionConfigurationWithIdentifier(string identifier) { return default(NSURLSessionConfiguration); }                /// <summary>        /// Returns a session configuration object that allows HTTP and HTTPS uploads or downloads to be performed in the background.        /// </summary>        /// <param name="identifier">The unique identifier for the configuration object. This parameter must not be nil or an empty string.</param>        [iOSVersion(7)]        [Export("backgroundSessionConfiguration")]        public static NSURLSessionConfiguration BackgroundSessionConfiguration(string identifier) { return default(NSURLSessionConfiguration); }                /// <summary>        /// The background session identifier of the configuration object. (read-only)        /// </summary>        [iOSVersion(7)]        [Export("identifier")]        public string Identifier { get; private set; }                /// <summary>        /// A dictionary of additional headers to send with requests.        /// </summary>        [iOSVersion(7)]        public Dictionary<NSObject, AnyObject> HTTPAdditionalHeaders { get; set; }                /// <summary>        /// The type of network service.        /// </summary>        [iOSVersion(7)]        [Export("networkServiceType")]        public NSURLRequestNetworkServiceType NetworkServiceType { get; set; }                /// <summary>        /// A Boolean value that determines whether connections should be made over a cellular network.        /// </summary>        [iOSVersion(7)]        [Export("allowsCellularAccess")]        public bool AllowsCellularAccess { get; set; }                /// <summary>        /// The timeout interval to use when waiting for additional data.        /// </summary>        [iOSVersion(7)]        [Export("timeoutIntervalForRequest")]        public NSTimeInterval TimeoutIntervalForRequest { get; set; }                /// <summary>        /// The maximum amount of time that a resource request should be allowed to take.        /// </summary>        [iOSVersion(7)]        [Export("timeoutIntervalForResource")]        public NSTimeInterval TimeoutIntervalForResource { get; set; }                /// <summary>        /// The identifier for the shared container into which files in background URL sessions should be downloaded.        /// </summary>        [iOSVersion(8)]        [Export("sharedContainerIdentifier")]        [Optional]        public string SharedContainerIdentifier { get; set; }                /// <summary>        /// A policy constant that determines when cookies should be accepted.        /// </summary>        [iOSVersion(7)]        public NSHTTPCookieAcceptPolicy HTTPCookieAcceptPolicy { get; set; }                /// <summary>        /// The cookie store for storing cookies within this session.        /// </summary>        [iOSVersion(7)]        [Optional]        public NSHTTPCookieStorage HTTPCookieStorage { get; set; }                /// <summary>        /// A Boolean value that determines whether requests should contain cookies from the cookie store.        /// </summary>        [iOSVersion(7)]        public bool HTTPShouldSetCookies { get; set; }                /// <summary>        /// The maximum TLS protocol version that the client should request when making connections in this session.        /// </summary>        [iOSVersion(7)]        public SSLProtocol TLSMaximumSupportedProtocol { get; set; }                /// <summary>        /// The minimum TLS protocol that should be accepted during protocol negotiation.        /// </summary>        [iOSVersion(7)]        public SSLProtocol TLSMinimumSupportedProtocol { get; set; }                /// <summary>        /// A credential store that provides credentials for authentication.        /// </summary>        [iOSVersion(7)]        [Optional]        public NSURLCredentialStorage URLCredentialStorage { get; set; }                /// <summary>        /// The URL cache for providing cached responses to requests within the session.        /// </summary>        [iOSVersion(7)]        [Optional]        public NSURLCache URLCache { get; set; }                /// <summary>        /// A predefined constant that determines when to return a response from the cache.        /// </summary>        [iOSVersion(7)]        [Export("requestCachePolicy")]        public NSURLRequestCachePolicy RequestCachePolicy { get; set; }                /// <summary>        /// A Boolean value that indicates whether the app should be resumed or launched in the background when transfers finish.        /// </summary>        [iOSVersion(7)]        [Export("sessionSendsLaunchEvents")]        public bool SessionSendsLaunchEvents { get; set; }                /// <summary>        /// A Boolean value that determines whether background tasks can be scheduled at the discretion of the system for optimal performance.        /// </summary>        [iOSVersion(7)]        [Export("discretionary")]        public bool Discretionary { get; set; }                /// <summary>        /// An array of extra protocol subclasses that handle requests in a session.        /// </summary>        [iOSVersion(7)]        [Export("protocolClasses")]        public AnyObject[] ProtocolClasses { get; set; }                /// <summary>        /// The maximum number of simultaneous connections to make to a given host.        /// </summary>        [iOSVersion(7)]        public int HTTPMaximumConnectionsPerHost { get; set; }                /// <summary>        /// A Boolean value that determines whether the session should use HTTP pipelining.        /// </summary>        [iOSVersion(7)]        public bool HTTPShouldUsePipelining { get; set; }                /// <summary>        /// A dictionary containing information about the proxy to use within this session.        /// </summary>        [iOSVersion(7)]        [Export("connectionProxyDictionary")]        public Dictionary<NSObject, AnyObject> ConnectionProxyDictionary { get; set; }    }}